003e\u003c![CDATA[## Model Ranks Based On Group Statistical Bias and Variance Metrics]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[The below heatmap includes all group bias and variance metrics and all defined models.\nOn this plot, colors display ranks where 1 is the best model for the metric. These ranks are conditioned on difference or ratio operations used to create these group metrics:\n* If the metric is created based on the difference operation, **closer values to zero** have ranks that are closer to the first rank\n* If the metric is created based on the ratio operation, **closer values to one** have ranks that are closer to the first rank\n\nThis plot can give you the following benefits:\n* You can visually compare all models across all group metrics\n* You can visually understand where one model is better or worse than other models\n* You can find the best and worst models for each group metric]]\u003e\u003c/Text\u003e\u003cPlot type=\"image/svg+xml\" size=\"108558\" uploaded_filename=\"dp-tmp-4iqh_33p.svg\" responsive=\"false\" scale=\"1.0\" src=\"data:image/svg+xml;base64,PD94bWwgdmVyc2lvbj0iMS4wIiBlbmNvZGluZz0idXRmLTgiIHN0YW5kYWxvbmU9Im5vIj8+CjwhRE9DVFlQRSBzdmcgUFVCTElDICItLy9XM0MvL0RURCBTVkcgMS4xLy9FTiIKICAiaHR0cDovL3d3dy53My5vcmcvR3JhcGhpY3MvU1ZHLzEuMS9EVEQvc3ZnMTEuZHRkIj4KPHN2ZyB4bWxuczp4bGluaz0iaHR0cDovL3d3dy53My5vcmcvMTk5OS94bGluayIgd2lkdGg9IjYxNS41Mjg1OTRwdCIgaGVpZ2h0PSI1ODQuNjEyNzM0cHQiIHZpZXdCb3g9IjAgMCA2MTUuNTI4NTk0IDU4NC42MTI3MzQiIHhtbG5zPSJodHRwOi8vd3d3LnczLm9yZy8yMDAwL3N2ZyIgdmVyc2lvbj0iMS4xIj4KIDxtZXRhZGF0YT4KICA8cmRmOlJERiB4bWxuczpkYz0iaHR0cDovL3B1cmwub3JnL2RjL2VsZW1lbnRzLzEuMS8iIHhtbG5zOmNjPSJodHRwOi8vY3JlYXRpdmVjb21tb25zLm9yZy9ucyMiIHhtbG5zOnJkZj0iaHR0cDovL3d3dy53My5vcmcvMTk5OS8wMi8yMi1yZGYtc3ludGF4LW5zIyI+CiAgIDxjYzpXb3JrPgogICAgPGRjOnR5cGUgcmRmOnJlc291cmNlPSJodHRwOi8vcHVybC5vcmcvZGMvZGNtaXR5cGUvU3RpbGxJbWFnZSIvPgogICAgPGRjOmRhdGU+MjAyMy0wMi0wNlQwMTozNToxMC4zMjA5Mjk8L2RjOmRhdGU+CiAgICA8ZGM6Zm9ybWF0PmltYWdlL3N2Zyt4bWw8L2RjOmZvcm
